svg.script:
function init(evt){
if ( window.svgDocument == null ) {
svgDocument = evt.target.ownerDocument;
svgDocument.incrementScene = this.incrementScene;
svgDocument.decrementScene = this.decrementScene;
svgDocument.drawRiver = this.scene1;}
}
